import "./NavTab.css"


function NavTab() {

    return (
    <div className ="navtab">
        <nav className="navtab__link-container">
            <button className="navtab__link-container_link" href="#aboutproject">О проекте</button>
            <button className="navtab__link-container_link" href="#techs">Технологии</button>
            <button className="navtab__link-container_link" href="#aboutme">Студент</button>
        </nav>
    </div>
        );
    }
    
    export default NavTab;
